import{_ as a,o as i,c as r,a as l}from"./app-13ec2ce8.js";const n={},o=l('<h1 id="ðŸ“”-19-dars" tabindex="-1"><a class="header-anchor" href="#ðŸ“”-19-dars" aria-hidden="true">#</a> ðŸ“” 19-dars</h1><h2 id="server" tabindex="-1"><a class="header-anchor" href="#server" aria-hidden="true">#</a> Server</h2><img src="https://upload.wikimedia.org/wikipedia/commons/thumb/c/c9/Client-server-model.svg/1200px-Client-server-model.svg.png"><p>Server - bu tarmoq orqali mijozlar deb ataladigan boshqa kompyuterlarga xizmatlar yoki resurslarni taqdim etadigan kompyuter yoki tizim. U ma&#39;lumotlarni saqlash, qayta ishlash va tarmoq aloqasi kabi har xil turdagi so&#39;rovlarni boshqarish va boshqarish uchun mo&#39;ljallangan.</p><p>Serverlar - bu aniq vazifalarni samarali bajarishga imkon beruvchi yuqori unumdor apparat va maxsus dasturiy ta&#39;minotga ega kuchli kompyuterlar. Ular odatda uzluksiz va ishonchli ishlash uchun tuzilgan bo&#39;lib, bir nechta mijozlarga ular taqdim etgan resurslarga ulanish va ulardan foydalanish imkonini beradi.</p><p>Serverlar taklif qilayotgan xizmatlarga qarab turli maqsadlarga xizmat qilishi mumkin. Ba&#39;zi keng tarqalgan server turlariga quyidagilar kiradi:</p><p>Veb-serverlar: Bu serverlar veb-saytlarni joylashtiradi va HTTP kabi protokollar yordamida internet orqali mijozlarga veb-sahifalarni yetkazib beradi.</p><p>Fayl serverlari: Ular fayllarni saqlaydi va boshqaradi, bu esa mijozlarga tarmoq ichidagi ma&#39;lumotlarga kirish va almashish imkonini beradi.</p><p>Ma&#39;lumotlar bazasi serverlari: Bu serverlar ma&#39;lumotlar bazalarini boshqaradi va tuzilgan so&#39;rovlar tillari (SQL) yoki boshqa ma&#39;lumotlar bazasini boshqarish tizimlari orqali saqlangan ma&#39;lumotlarga kirishni ta&#39;minlaydi.</p><p>Ilova serverlari: Ular ilovalarni bajaradi va boshqaradi, ilovalar mantig&#39;i, ma&#39;lumotlarni qayta ishlash va foydalanuvchi autentifikatsiyasi kabi vazifalarni bajaradi.</p><p>Pochta serverlari: Ushbu serverlar elektron pochta xabarlarini jo&#39;natish, qabul qilish va saqlash bilan shug&#39;ullanadi.</p><p>DNS serverlari: Ular domen nomlarini IP manzillarga tarjima qiladi, bu esa mijozlarga domen nomlari bo&#39;yicha veb-saytlarga kirish imkonini beradi.</p><p>Bular server turlarining bir nechta misollari va muayyan ehtiyojlar va funksiyalarga qarab boshqa ko&#39;plab maxsus serverlar mavjud. Serverlar mijozlarga resurslar va xizmatlarni taqdim etishda, turli tarmoq muhitlarida aloqa va ma&#39;lumotlar almashinuvini osonlashtirishda hal qiluvchi rol o&#39;ynaydi.</p><h2 id="npm" tabindex="-1"><a class="header-anchor" href="#npm" aria-hidden="true">#</a> NPM</h2><p>NPM (Node Package Manager) Node.js ekosistemida foydalanuvchilarga JavaScript paketlarini boshqarish uchun ishlatiladigan bir paket ma&#39;naviyati va boshqaruv tizimidir. NPM, Node.js-ni o&#39;rnatgan bo&#39;lib keladi va proyektlar uchun tarkibiy paketlarni o&#39;rnatish, yangilashish, o&#39;chirish va boshqarish imkonini beradi.</p><p>NPM, paketlarni boshqarish va ulardan foydalanish uchun komandalar jamlanmasini taqdim etadi. Bu komandalar orqali paketlar o&#39;rnatiladi, versiyalari belgilanadi, proyektga bog&#39;langan qo&#39;shimcha qo&#39;llanmalar yaratiladi va boshqa boshqaruv amallarini bajarish mumkin bo&#39;ladi.</p><p>NPM orqali ma&#39;lum bir paketni o&#39;rnatish uchun, terminalda npm install paket-nomi komandasini ishlatish mumkin. Bu komanda paketni o&#39;rnatadi va uni proyektga qo&#39;shadi. Shuningdek, package.json nomli faylda proyektga bog&#39;langan barcha paketlarni va ularning versiyalarini saqlaydi.</p><p>NPM, milyonlarlab paketlarni o&#39;z ichiga oladi, masalan, veb loyihalarda ishlatiladigan frameworklar, kitobxonalar, stil qo&#39;llanmalari, testlar, sintaksis to&#39;g&#39;rilash qo&#39;llanmalari kabi ko&#39;plab funksiyonalarni o&#39;z ichiga oladi. Foydalanuvchilar shu paketlardan foydalanib, o&#39;z loyihalari uchun tayyor modullarni qisqarish va osonlashadi.</p><p>NPM, toplumda keng qo&#39;llaniladigan, yuqori sifatli paketlarni o&#39;z ichiga oladi va bu orqali dasturchilarga modullarni boshqarish, ulardan foydalanish va ulardagi bog&#39;lanishlarni osonlashtirish imkonini beradi. NPM, Node.js ning o&#39;rnatilgan qismi hisoblanadi va dasturchilar uchun qulay va yaxshi tajribani ta&#39;minlayadi.</p><h2 id="ajax" tabindex="-1"><a class="header-anchor" href="#ajax" aria-hidden="true">#</a> AJAX</h2><p>AJAX - bu inglizchadan &quot;Asynchronous JavaScript and XML&quot; so&#39;zlarining qisqartmasi bo&#39;lib, veb dasturlashda sahifani yangilamasdan turub, asinxron ravishda serverga so&#39;rovlarni yuborish va server qaytargan javobni fon rejimida qabul qilish imkonini beruvchi JavaScript, hamda XML bilan amallarni bajarish texnologiyasidir. Shunda AJAX &quot;Asinxron JavaScript va XML&quot; deb tarjima qilinadi. AJAX haqida batafsil maqola: <a href="https://uz.delachieve.com/ajax-bu-nima-asynchronous-javascript-va-xml-afzalliklari-va-kamchiliklari/" target="_blank">Batafsil ma&#39;lumot</a></p><h2 id="xml" tabindex="-1"><a class="header-anchor" href="#xml" aria-hidden="true">#</a> XML</h2><p>new XMLHttpRequest() yordamida yaratilgan obyekt, brauzer tomonidan o&#39;rtacha HTTP(S) so&#39;rovlarni jo&#39;natish uchun ishlatiladigan asinxron so&#39;rov obyektidir. XMLHttpRequest (XHR) JavaScriptda darhol so&#39;rov yuborish va ma&#39;lumotlarni olish uchun qo&#39;llaniladi.</p><p>XHR obyekti yaratildiktan so&#39;ng, uni ishlatib, brauzer tomonidan serverga HTTP(S) so&#39;rovlar yuborilishi, ma&#39;lumotlarni qabul qilishi va javobni olishi mumkin. Ushbu obyekt orqali asinxron so&#39;rovlar yuborish va javobni kutish, asosiy veb ilovalarda ma&#39;lumot almashish va dinamik ma&#39;lumotlarni yuklash uchun foydalaniladi.</p><p>Quyidagi kodda new XMLHttpRequest() obyekti yaratilgan va uni xhr o&#39;zgaruvchisiga tayinlash uchun foydalanilgan misol ko&#39;rsatilgan:</p><p>Amaliyot: AJAX yordamida Valyuta kursi:</p>',26),s=[o];function t(e,h){return i(),r("div",null,s)}const u=a(n,[["render",t],["__file","19-dars.html.vue"]]);export{u as default};
